import sys

def skew(s):
	count = 0
	lskew = []
	for i in s:
		if i == 'C':
			count = count - 1
		elif i == 'G':
			count = count + 1
		lskew.append(count)
	return lskew

def minid(l):
	idx = []
	value = sys.maxint
	size = len(l)
	for i in range(size):
		if l[i] < value:
			value = l[i]
			idx = []
			idx.append(i)
		if l[i] == value:
			idx.append(i)
	return idx

s = ''
out = set(minid(skew(s)))

